import React from 'react';
import {Nav,Navbar,Container} from 'react-bootstrap';
import styled from 'styled-components';
import {Link,NavLink} from 'react-router-dom';
import $ from 'jquery';


$('ul.navbar-nav > li > Link').on('click', function(){
  $('.navbar-collapse').collapse('hide');
  console.log('test');
});

export const Menu = (props) => (
    <nav className="navbar navbar-expand-lg custom_nav">
    <div className="container">
    {/* <a className="navbar-brand" href="#">SEO</a> */}
    <Link className="nav-link" to="/">SEO</Link>
    <button className="navbar-toggler collapsed" type="button" data-toggle="collapse" data-target="#mynav" aria-expanded="false" aria-controls="mynav">
<span className="navbar-toggler-icon"><i className="fas fa-bars"></i></span>
</button>

<div className="collapse navbar-collapse" id="mynav">
<ul className="navbar-nav ml-auto">
  <li className="nav-item">
    <Link className="nav-link" to="/">Home </Link>
  </li>
  <li className="nav-item">
    <Link className="nav-link" to="/services">Services</Link>
  </li>
  <li className="nav-item">
    <Link className="nav-link" to="/price">Pricing</Link>
  </li>
  <li className="nav-item">
    <Link className="nav-link" to="/portfolio">Portfolio</Link>
  </li>
  <li className="nav-item">
  <NavLink className="nav-link" to="/blog">Blog</NavLink>
  </li>
  <li className="nav-item">
    <Link className="nav-link" to="/contact">Contact</Link>
  </li>

  
 
</ul>

</div>
    </div>
</nav>
)
